When running the above inputs in perpendicular directions, voltage can be observed dropping from ~12.5V to nearly ~6 volts. In addition, all four wheels snap to an intermediary angle before snapping to their final positions (I will record a video of this ASAP). The sound made during this motion is also quite unpleasant and it is clearly jittery.

We currently are unable to conclude whether this issue is a physical issue with our swerve modules or purely a code issue. For the record, we also experience various common swerve issues such as rotational drift and a drift to the left when being commanded forwards.

Any ideas would be appreciated.

We have “jitters” on one of our swerve bots, and we needed to adjust steer PID to get rid of it. Also the latest version of the CTR firmware and generated code greatly reduced it. It SEEMS the jitters may be related to unusually high friction/force feed during the steer in the module itself, rather than a friction during the drive. Our robot also drives fine even with the values specified by the CTR generator (if you disregard the jitter). In any case - the “corrected” values that we used to reduce the jitter are:

